import React from 'react';
import LogoSvg from '../../assets/logo.svg';

import { 
    Container, 
    Header, 
    logoImg
} from './styles';

const Aside: React.FC = () => {
    return (
        <Container>
            <Header>
                <logoImg>
                    <img src = {LogoSvg} alt = "logo"/>
                </logoImg >
            </Header>
        </Container>
    );
}

export default Aside;
